import React from 'react';
import './Footer.css';

function Footer() {
  return (
    <footer className="footer">
      <div className="footer-content">
        <p>ⓒ 2025 Apple Clone. 본 사이트는 학습용 클론 프로젝트입니다.</p>
      </div>
    </footer>
  );
}

export default Footer;
